  checkAnon(v) {
    console.log('-V-V-V-V-V-V-V-V-V-V-V-V-V-V-V-V-V-V-V-V-V-V-V')
    var pattern = new RegExp('\\banon[0-9]*\\b')// \banon[0-9]*\b cu backslașurile escapate
    if (pattern.test(v) == true) {
      if (v == AppComponent.anon) {
        this.combi = false
        document.getElementById('nume')!.style.borderLeft = '2mm solid green'
        return
      }
      this.combi = true
      document.getElementById('nume')!.style.borderLeft = '2mm solid red'
    }
  }

