  onInregistrareSubmit() {
    this.procesareinregistrare = true
    AppComponent.Uzer.limbuto = false//fără nu dispare limbuto după înregistrare
    AppComponent.Uzer.mina = 'dreptaci'
    AppComponent.Uzer.culoare = 'lightcoral'
    console.log('NNNN----NNNN----NNNN----NNNN----NNNN----NNNN----NNNN----NNNN----NNNN----NNNN----NNNN----')
    //AppComponent.Uzer.poza.src = "data:image/jpeg;base64,"
    AppComponent.Uzer.poza = ''
    console.log(AppComponent.Uzer.poza.src)
    console.log('NNNN----NNNN----NNNN----NNNN----NNNN----NNNN----NNNN----NNNN----NNNN----NNNN----NNNN----')
    console.log('onInregistrareSubmit~~~~~~~~~~~~~~~~~~~~~~~~~~~')
    console.log(AppComponent.Uzer,' ~~~~~~~~~~~~~~~~~~~~~~~~~~~')
    this.http.post(this.baseUrl + 'uzer/inregistrare', AppComponent.Uzer)
      .subscribe((s: any) => {
        AppComponent.Uzer = s
        if (s.etc == "denumirea este obligatorie") {
          if (AppComponent.Uzer.limba == 'en') {
            AppComponent.Uzer.etc = 'the name is mandatory'
          }
          if (AppComponent.Uzer.limba == 'hu') {
            AppComponent.Uzer.etc = 'a név kötelező'
          }
        }
        if (s.etc == "această adresă e folosită deja") {
          if (AppComponent.Uzer.limba == 'en') {
            AppComponent.Uzer.etc = 'this address is already in use'
          }
          if (AppComponent.Uzer.limba == 'hu') {
            AppComponent.Uzer.etc = 'ez a cím már használatban van'
          }
        }
        if (s.etc == "parola trebuie să aibă minim opt caractere,\nsă nu fie un cuvînt englez, maghiar(todo) sau romîn\nși să nu fie emailul sau numele") {
          if (AppComponent.Uzer.limba == 'en') {
            AppComponent.Uzer.etc = 'the password must have at least eight characters,\nnot be an English, Hungarian (todo) or Romanian word\nand not be the email or the name'
          }
          if (AppComponent.Uzer.limba == 'hu') {
            AppComponent.Uzer.etc = 'a jelszónak legalább nyolc karakterből kell állnia,\nnem lehet angol, magyar (todo) vagy román szó\nés nem lehet az e-mail cím vagy a név'
          }
        }
        if (s.etc == "înregistrat cu succes.\nparola e conservată cu sare și haș, nimeni nu o poate vedea\ndar ar fi bine să o schimbi din cînd în cînd") {
          if (AppComponent.Uzer.limba == 'en') {
            AppComponent.Uzer.etc = 'registered successfully.\nthe password is preserved with salt and hash, no one can see it\nbut it would be good to change it from time to time'
          }
          if (AppComponent.Uzer.limba == 'hu') {
            AppComponent.Uzer.etc = 'sikeresen regisztrált.\na jelszót só és hash őrzi, senki nem látja\nde jó lenne időnként megváltoztatni'
          }
        }
        console.log(AppComponent.Uzer.limbuto,' -LIMBUTO-LIMBUTO-LIMBUTO-LIMBUTO-LIMBUTO')
        AppComponent.anon = s.nume
        this.procesareinregistrare=false
        console.log(AppComponent.Uzer.etc, ' <<<Îetc<<<Îetc<<<Îetc<<<Îetc<<<Îetc<<<Îetc<<<Îetc<<<Îetc')
        console.log(AppComponent.Uzer, ' <<<Îtot<<<Îtot<<<Îtot<<<Îtot<<<Îtot<<<Îtot<<<Îtot<<<Îtot')
        var x = document.getElementById("toast")
        if (AppComponent.Uzer.etc?.length! > 30) {
          x!.className = "show9s"
          setTimeout(function () { x!.className = x!.className.replace("show9s", ""); }, 9000)
        }
        if (AppComponent.Uzer.etc?.length! <= 30) {
          x!.className = "show3s";
          setTimeout(function () { x!.className = x!.className.replace("show3s", ""); }, 3000)
        }
        if (AppComponent.Uzer.email != null && AppComponent.Uzer.prl != null && AppComponent.Uzer.etc != "denumirea este obligatorie") {
          this.http.post(this.baseUrl + 'uzer/intrare', AppComponent.Uzer)
            .subscribe((s: any) => {
              AppComponent.UzerState = 'intrat'
            })
        }
        ///////////////////
        if (AppComponent.Uzer.limbuto == false) {
          document.getElementById('enhuro')!.style.display = 'none'
        }
        ///////////////////
      })
  }

