  Sod(mina: any) {
    console.log('{{{{{{{{{{{{{{{{{{{{{{{{', mina, '}}}}}}}}}}}}}}}}}}}}}}}}}}}}}}')
    AppComponent.Uzer.mina=mina
    //mina=mina.target.value//altfel nu merge în Chrome //le cu butoane nu mai trebe se pare
    this.robSod.communicateMessage(mina);//teoretic că l-as putea folosi direct în html, dacă îl declar ca field mă gîndesc
    if (AppComponent.Uzer.mina == 'stingaci') {
      //document.getElementById('enhuro')!.style.left = ''
      document.getElementById('enhuro')!.style.right = '0%'
      document.getElementById('enhuro')!.style.transform = 'translateX(6mm) scaleX(-1)'//nu poate exista decît o .transform
    }
    if (AppComponent.Uzer.mina == 'dreptaci') {
      //document.getElementById('enhuro')!.style.left = ''
      document.getElementById('enhuro')!.style.right = ''
      document.getElementById('enhuro')!.style.transform = 'translateX(-6mm)'
    }
  }

